s:0:"";s:7:"vod_tpl";s:0:"";s:12:"vod_tpl_play";s:0:"";s:12:"vod_tpl_down";s:0:"";s:9:"vod_isend";i:1;s:8:"vod_lock";i:0;s:9:"vod_level";i:0;s:13:"vod_copyright";i:0;s:10:"vod_points";i:0;s:15:"vod_points_play";i:0;s:15:"vod_points_down";i:0;s:8:"vod_hits";i:879;s:12:"vod_hits_day";i:449;s:13:"vod_hits_week";i:769;s:14:"vod_hits_month";i:857;s:12:"vod_duration";s:0:"";s:6:"vod_up";i:496;s:8:"vod_down";i:565;s:9:"vod_score";s:3:"6.0";s:13:"vod_score_all";i:3072;s:13:"vod_score_num";i:512;s:8:"vod_time";i:1563000035;s:12:"vod_time_add";i:1563000035;s:13:"vod_time_hits";i:0;s:13:"vod_time_make";i:0;s:10:"vod_trysee";i:0;s:13:"vod_douban_id";i:0;s:16:"vod_douban_score";s:3:"0.0";s:9:"vod_reurl";s:0:"";s:11:"vod_rel_vod";s:0:"";s:11:"vod_rel_art";s:0:"";s:7:"vod_pwd";s:0:"";s:11:"vod_pwd_url";s:0:"";s:12:"vod_pwd_play";s:0:"";s:16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:3927:"夏布洛尔身为法国新浪潮中坚力量，将此片《爱丽丝最后的逃离》的氛围渲染涂抹得紧张不安悬疑十足，大量不和谐的音符充斥在变异的空间里，制造了一种超现实的迷离气氛，焉知真假难辨是非 影片开始，眼中只有自我的男友躺在地板上侃侃而谈，完全不理会爱丽丝欲言又止的目光，直到爱丽丝宣布分手消息，他才醒悟然又迷惑，通常男人认为女人提出分手的原因多数是有了新欢，然而爱丽丝微笑着告诉他非也，或许这个不是理由的理由，通常最让男人不解，也是最决绝的，此事女人的自觉意识一旦复苏，没有什么可以阻止她走上娜拉之路。 可惜这位娜拉出师未捷身先死，在大雨中遭遇车祸香消玉殒，临死之前执念未消壮志未酬，心里幻象四伏、脑中波涛汹涌，于是一出灵肉濒临分离前夕的荒诞剧开场了。爱丽丝驾车漫游在荒野雨景，突见一座城堡，一贵族老者殷勤招待，次日醒来老者与仆人皆不见，但有早餐为之备齐；惊讶之余，爱丽丝留下感谢继续前行，然绝望地发现绕路前行，不过是做重复的循环圆周运动，突空降一温文尔雅男子，告诉她别问任何问题，作抱臂围观状；爱丽丝只得又回到城堡，外面草地上一个少年，同样警戒她别发问，并为她捉来一只小鸟；面对越来越诡异的局面，爱丽丝再做努力，开车到一加油站，同样遭遇诡异，窗外偷窥的一男扮女装的少年、舞会上行将就木的老人突然复活；接着场景再次切换到开始时的雨夜，贵族老人早已恭候于此，时间转了个圈又回到了原地，一切和最初无异，老人告诉她，这是一个游戏，游戏规则就是不许发问，同时也告诉她，别妄想离开此地，不过明早可以通过一扇她觊觎已久、怀疑已久的小门，回到真实世界。 当然，后来我们看到爱丽丝并未如愿回到现实，她在清晨第一束阳光射进屋子，一步一步走向小门时，她的身影隐在黑暗里，同时镜头切换到车内她死去的脸庞，梦魇和真实终于接轨，亦完成循环的概念。 本片有很多隐喻。她负气离开自大男友，潜意识里希望有个如父辈的长者来安慰她，给予她一个温暖平和的港湾；温文男子在她需要帮助时并未伸手，女人要看到墙外风景，仍需自己付出努力，即使墙外不是理想情景；少年为她捕获的鸟在玻璃上扑棱，象征她在男性角色充溢的城堡里，只能作徒劳反抗，最终仍和她一起倒在倾斜的地板上。 仆人对她说过两句意味深长的话“夫人，我们这里不太在乎时间。”钟摆充当了一个很重要的道具，一旦她进入“虚幻”世界，钟摆便停止摆动，一旦她脱身来到“真实”，钟摆又恢复工作，这段缺失的、凝固的时间在摆动之间被定格；另一句是“如果你想翻过墙，你就做得到”，人通常在柳暗花明前的最后一刻放弃到手的光明，只因一时的恐惧，因此永远难以逃离的，是自己禁锢的内心、恐惧的意识、自身的软弱，因此爱丽丝至死都无法逃离，女性的悲剧宿命，娜拉离家后的续集故事之开放结局之一。 片名命为《爱丽丝最后的逃离》，是否变异自《爱丽丝漫游仙境》，只是这位爱丽丝的神游终以流离失所告终，从车后紧紧跟随的全景、窗外镜头的推进，无时不让观者感觉到框外摄影机的偷窥，无时不强调着画外人的第三只眼地位，或许这是新浪潮的另一大特色吧，我又要举格里耶《嫉妒》的例子了，这个上帝视角即为老者口中“游戏”的制造者，虽然这一切只是爱丽丝一缕香魂袅袅抵达天庭时的海市蜃楼而已。";s:13:"vod_play_from";s:9:"zuidam3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:60:"BD$https://eth.ppzuida.com/20190423/5533_3984065b/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:20;s:9:"type_name";s:6:"福利";s:7:"type_en";s:4:"fuli";s:9:"type_sort";i:5;s:8:"type_mid";i:1;s:8:"type_pid";i:0;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:0:"";s:8:"type_des";s:0:"";s:10:"type_title";s:0:"";s:10:"type_union";s:0:"";s:11:"type_extend";a:8:{s:5:"class";s:0:"";s:4:"area";s:0:"";s:4:"lang";s:0:"";s:4:"year";s:0:"";s:4:"star";s:0:"";s:8:"director";s:0:"";s:5:"state";s:0:"";s:7:"version";s:0:"";}s:8:"childids";N;}s:6:"type_1";N;}i:37;a:80:{s:6:"vod_id";i:66777;s:7:"type_id";i:20;s:9:"type_id_1";i:0;s:8:"group_id";i:0;s:8:"vod_name";s:6:"回放";s:7:"vod_sub";s:0:"";s:6:"vod_en";s:7:"huifang";s:10:"vod_status";i:1;s:10:"vod_letter";s:1:"H";s:9:"vod_color";s:0:"";s:7:"vod_tag";s:0:"";s:9:"vod_class";s:6:"伦理";s:7:"vod_pic";s:70:"https://img.tupian-zuida.com/pic/upload/vod/2019-06-02/15594563814.jpg";s:13:"vod_pic_thumb";s:0:"";s:13:"vod_pic_slide";s:0:"";s:9:"vod_actor";s:43:"George,Hamilton,Tawny,Kitaen,Shannon,Whirry";s:12:"vod_director";s:12:"Oley,Sassone";s:10:"vod_writer";s:0:"";s:10:"vod_behind";s:0:"";s:9:"vod_blurb";s:240:"回放（1996年）是的一部分sexploitation，部分惊悚片，都好！在皮肤方面，的黄褐色Kitaen和她的丈夫患有从卧室booboos感谢他的工作的应变他们决定治愈是有点换妻摆动。但丈夫的同事，";s:11:"vod_remarks";s:0:"";s:11:"vod_pubdate";s:0:"";s:9:"vod_total";i:0;